import gql from 'graphql-tag';

export const CREATE_ACCESS_LEVEL = `
mutation createLevel($level_name: String!, $description: String){
    createLevel(levelIput:{level_name:$level_name,description:$description}
          ){ 
            id
            level_name
            description
            date_created
            date_updated
     }
     }
`

export const CREATE_DESIGNATIONS = `
mutation  createDesignations($designation_name: String, $description: String, level_id: String) {
  createDesignations (data: {
    description: $designation_name
    designation_name: $designation_name
    level_id: "644114975ff7ca52321065ae"
  }){
    designation_name
    level_id
  }
}
`
